const ExpenseDate = ({detail}) => {

    const month = detail.date.toLocaleString('en-US', { month : 'long'});
    const day = detail.date.toLocaleString('en-US', { day : '2-digit'});
    const year = detail.date.getFullYear();


    return (
    <div> 
        <div >{month}</div>
        <div >{day}</div>
        <div >{year}</div>
    </div>
    );
};

export default ExpenseDate;
